import React from "react";
import "./style.css";

function Header() {
  return (
    <nav class="navbar">
            <ul>
                <li class="brand">
                    <a href="/">Clicky Game</a>
                </li>
                <li class="">{props.msg}</li>
                <li>Score: {props.score} | Top Score: {props.topscore}</li>
            </ul>
        </nav>
  );
}

export default Header;
